import './ShowResults.css';

const ShowResults = (props) => {
	// console.log(props.userData);
	// console.log(props.userData.distanse);
	// console.log(props.fuelCost);
	// console.log(props.dayCost);
	// console.log(props.numberOfDays);
	// console.log(props.numberOfYear);
	// console.log(props.category)
	const petrolCost = props.userData.distanse * props.fuelCost;
	const costAllDays = props.numberOfDays * props.dayCost;
	const costCategory = Math.floor(
		(petrolCost + costAllDays) * (props.userData.category - 1)
	);
	const costNet = petrolCost + costAllDays + costCategory;
	console.log(costNet);
	const years = new Date().getFullYear() - props.userData.year;
	const costAvailable = 0;
	const costYears = 0;
	if (props.userData.available < 3 && years < 5) {
		costNet = (petrolCost + costAllDays + costCategory) * 1.15 * 1.2;
		costAvailable = costNet * 0.15;
	}
	if (years < 5) {
		costNet *= 1.2;
		costYears = costNet * 0.15;
	}
	const costGross = costNet * 1.23;
	return (
		<div>
			<h1>Łączny koszt wynajmu: {costGross}</h1>
			<ul>
				<li>Koszt paliwa: {petrolCost} </li>
				<li>Koszt spowodowany liczbą dni wypożyczenia: {costAllDays}</li>
				<li>
					Koszt spowodowany czasem posiadania prawa jazdy:
					{costYears}
				</li>
				<li>Koszt marką samochodu: {costCategory}</li>
				<li>
					Koszt liczbą modeli samochodu:
					{costAvailable}
				</li>
				<li>Koszt netto: {costNet} </li>
				<li>Koszt brutto: {costGross} </li>
			</ul>
			<button onClick={props.Change}>Wróć</button>
		</div>
	);
};

export default ShowResults;
